import Foundation

struct UserInterface {
    // gzip -9 Resources/Frontend/favicon.ico  -k -c | base64
    enum Element: String, CaseIterable {
        case faviconico
        case indexhtml
        case maincss
        case uibundlejs
        
        var fileName: String {
            switch self {
            case .faviconico:
                return "favicon.ico"
            case .indexhtml:
                return "index.html"
            case .maincss:
                return "main.css"
            case .uibundlejs:
                return "ui.bundle.js"
            }
        }
        var fileContent: String {
            switch self {
            case .faviconico:
                return Content.faviconico
            case .indexhtml:
                return Content.indexhtml
            case .maincss:
                return Content.maincss
            case .uibundlejs:
                return Content.uibundlejs
            }
        }
    
        struct Content {
            static let faviconico = ""
            static let indexhtml = ""
            static let maincss = ""
            static let uibundlejs = ""
        }
        
    }
    
    
}

